import React from 'react';
import styles from './Articles.module.css'; // Importing module styles for Articles component

// Remove the import of '../general.css' from here.
// Instead, import it globally in the root file like index.js or App.js

const Articles = () => {
  return (
    <div className={styles.articles} id="articles">
      <h2 className={styles.mainTitle}>Articles</h2>
      <div className={styles.container}>
        {Array.from({ length: 8 }).map((_, index) => (
          <div key={index} className={styles.box}>
            <img src={`/imgs/cat-0${index + 1}.jpg`} alt="" />
            <div className={styles.content}>
              <h3>Test Title</h3>
              <p>Lorem ipsum dolor sit amet consectetur, adipisicing elit. Reprehenderit</p>
            </div>
            <div className={styles.info}>
              <a href="/">Read More</a>
              <i className="fas fa-long-arrow-alt-right"></i>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Articles;
